import React from 'react';
import {card, button, city, conteiner, temperature, img} from './Card.module.css'

function Card(props) {
  // Acá va tu código
  return (
    <div className={card}>
      <button className={button} onClick={props.onClose({/* props.id */})}>X</button>

      <h1 className={city}> {props.name} </h1>

      <div className={conteiner}>
        <ul className={temperature}>
          <li> Máx.</li> 
          <li>{Math.round(props.max)+'°'}</li>
        </ul> 

        <ul className={temperature}>
          <li> Mín.</li> 
          <li>{Math.round(props.min)+'°'}</li>
        </ul> 

        <img src={`http://openweathermap.org/img/wn/${props.img}@2x.png`}
          alt="Weather"
          className={img}/>
      </div>
    </div>
  )
};

export default Card;
